import React from "react";
import bg from "./faq.png";

const Blogs = () => {
  return (
    <div>
      <div className="text-center">
        <p className="text-primary font-medium">Blogs</p>
        <p className="font-bold text-xl"> Get ready for healhy blogs </p>
      </div>
      <div className="flex">
        <div
          className="  flex flex-row justfy-center items-center  bg-cover w-64 h-64 rounded "
          style={{
            backgroundImage: `url(${bg})`,
            backgroundRepeat: "no-repeat",
            backgroundPosition: "center",
            backgroundColor:
              "linear-gradient(to top, var(--tw-gradient-stops));",
          }}
        >
          <div className="align-middle bg-no-repeat">
            <img src="/images/gradient.png" className="h-full"></img>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Blogs;
